description:
Barrow, amerikas nordligaste stad, norr om polcirkeln i Alaska slacks varje ar
ner 30 dagar. Ingen sol, ingenting folk som kan flyttar soderut under vintern. 
Da hemsoks staden av vampyrer som forstor deras mobiltelefoner for att avskarma dem fran yttervarlden och dricker sladhundarnas blod. Men snart far de smak pa nagot annat och mer mattande - manniskoblod.
Med bl.a. Josh Hartnett, Melissa George, Danny Huston och Bern Foster.

